var Formatter = {
	units: '',

	speed_K: 1000,
	size_K: 1000,
	mem_K: 1024,

	duration: function(seconds) {
		return new Date(seconds * 1000).toTimeString().replace(/.*(\d{2}:\d{2}:\d{2}).*/, "$1");
	},

	date: function(timestamp) {
		return new Date(timestamp * 1000);
	},

	filePriority: function(number) {
		if (number == -1) { return i18n.units.low; }
		if (number === 0) { return i18n.units.normal; }
		if (number == 1) { return i18n.units.high; }
	},

	percentageDone: function(leftUntilDone, totalSize) {
		return (Math.round(((totalSize - leftUntilDone) / totalSize) * 10000) / 100) + '%';
	},

	mem: function(bytes) {
		if (bytes < Formatter.mem_K)
			return [ bytes, i18n.units.mem_B_str ].join(' ');

		var convertedSize;
		var unit;

		if (bytes < Math.pow(Formatter.mem_K, 2)) {
			convertedSize = bytes / Formatter.mem_K;
			unit = i18n.units.mem_K_str;
		}

		else if (bytes < Math.pow(Formatter.mem_K, 3)) {
			convertedSize = bytes / Math.pow(Formatter.mem_K, 2);
			unit = i18n.units.mem_M_str;
		}

		else if (bytes < Math.pow(mem_K, 4)) {
			convertedSize = bytes / Math.pow(Formatter.mem_K, 3);
			unit = i18n.units.mem_G_str;
		}

		else {
			convertedSize = bytes / Math.pow(Formatter.mem_K, 4);
			unit = i18n.units.mem_T_str;
		}

		convertedSize = Math.round(convertedSize * 100) / 100;
		return [ convertedSize, unit ].join('');
	},

	ratio: function(downloadedBytes, uploadedBytes) {
		if (downloadedBytes === 0) return 0;
		return Math.floor((uploadedBytes / downloadedBytes) * 1000) / 1000;
	},

	size: function(bytes) {
		if (bytes < Formatter.size_K)
			return [ bytes, i18n.units.size_B_str ].join('');

		var convertedSize;
		var unit;

		if (bytes < Math.pow(Formatter.size_K, 2)) {
			convertedSize = bytes / Formatter.size_K;
			unit = i18n.units.size_K_str;
		}

		else if (bytes < Math.pow(Formatter.size_K, 3)) {
			convertedSize = bytes / Math.pow(Formatter.size_K, 2);
			unit = i18n.units.size_M_str;
		}

		else if (bytes < Math.pow(Formatter.size_K, 4)) {
			convertedSize = bytes / Math.pow(Formatter.size_K, 3);
			unit = i18n.units.size_G_str;
		}

		else {
			convertedSize = bytes / Math.pow(Formatter.size_K, 4);
			unit = i18n.units.size_T_str;
		}

		convertedSize = Math.round(convertedSize * 100) / 100;
		return [ convertedSize, unit ].join('');
	},

	speed: function(bytes) {
		if (bytes < Formatter.speed_K)
			return [ bytes, i18n.units.speed_B_str ].join('');

		var convertedSize;
		var unit;

		if (bytes < Math.pow(Formatter.speed_K, 2)) {
			convertedSize = bytes / Formatter.speed_K;
			unit = i18n.units.speed_K_str;
		}

		else if (bytes < Math.pow(Formatter.speed_K, 3)) {
			convertedSize = bytes / Math.pow(Formatter.speed_K, 2);
			unit = i18n.units.speed_M_str;
		}

		else if (bytes < Math.pow(speed_K, 4)) {
			convertedSize = bytes / Math.pow(Formatter.speed_K, 3);
			unit = i18n.units.speed_G_str;
		}

		else {
			convertedSize = bytes / Math.pow(Formatter.speed_K, 4);
			unit = i18n.units.speed_T_str;
		}

		convertedSize = Math.round(convertedSize * 100) / 100;
		return [ convertedSize, unit ].join('');
	},

	event: function(statusCode) {
		switch (statusCode) {
			case 0:
				return i18n.event.paused;

			case 1:
				return i18n.event.queuedForVerification;

			case 2:
				return i18n.event.verifyingLocalData;

			case 3:
				return i18n.event.queued;

			case 4:
				return i18n.event.downloading;

			case 5:
				return i18n.event.downloadedQueuedForSeeding;

			case 6:
				return i18n.event.seeding;

			case 8:
				return i18n.event.seeding;

			default:
				return i18n.event.unknown;
		}
	},
};
var activeTab = 'all';
var session = Storages.initNamespaceStorage('layeredWebUI').localStorage;

var TopBar = {
	statistics: function() {
		$('section.topBar p.additionalData span.statistics').unbind();
		$('section.topBar p.additionalData span.statistics').click(function() {
			Sidebar.open('statistics');

			$('section.sidebarOverflow').click(function() {
				clearInterval(Listener.sessionStatsInterval);
				$('section.sidebarOverflow').unbind();
			});
		});
	},

	filterBar: function() {
		$('section.header ul li').click(function() {
			var odd = true;

			$('section.header ul li[data-href="' + activeTab + '"]').removeClass('active');
			$(this).addClass('active');

			$('section.torrents').removeClass('all downloading seeding idling queued paused errored');
			$('section.torrents').addClass($(this).data('href'));

			$('section.torrents section.torrent').removeClass('suffix-2 tablet-suffix-5 prefix-2 tablet-prefix-5');

			activeTab = $(this).data('href');

			if (activeTab != 'all') {
				$('section.torrents').addClass('searchQuery');

				$('section.torrents section.torrent').each(function(index, torrent) {
					if ($(this).hasClass(activeTab)) {
						$(this).removeClass('suffix-2 tablet-suffix-5 prefix-2 tablet-prefix-5').addClass('result ' + ((odd) ? 'suffix-2 tablet-suffix-5' : 'prefix-2 tablet-prefix-5'));
						odd = !odd;
					}

					else {
						$(this).removeClass('suffix-2 tablet-suffix-5 prefix-2 tablet-prefix-5').removeClass('result');
					}
				});
			}

			else {
				$('section.torrents').removeClass('searchQuery');
				$('section.torrents section.torrent').removeClass('suffix-2 tablet-suffix-5 prefix-2 tablet-prefix-5').removeClass('result');
			}
		});
	}
};

var FloatingButtonHelper = {
	init: function() {
		$('section.floatingActions ul, section.floatingOptions ul').addClass('hidden');

		$('section.fixed-action-btn.click-to-toggle > a').click(function() {
			var menu = $(this).parent().find('ul');

			if (menu.hasClass('hidden')) {
				menu.removeClass('hidden');
			}

			else {
				setTimeout(function() { menu.addClass('hidden'); }, 250);
			}
		});
	}
}

var Sidebar = {
	open: function(view) {
		$('body').css('overflow', 'hidden');

		if (view == 'torrentInformation') { $('section.sidebar').removeClass('box-shadow'); }
		else { $('section.sidebar').addClass('box-shadow'); }

		$('section.sidebar > section').removeClass('active');
		$('section.sidebar > section.' + view).addClass('active');

		$('section.sidebar').animate({
			right: '0%'
		}, 300);

		$('section.sidebarOverflow').removeClass('hidden');

		$('section.sidebarOverflow').unbind();
		$('section.sidebarOverflow').click(function() {
			$('body').css('overflow', 'initial');

			$('section.sidebar').animate({
				right: '-100%'
			}, 300);

			$('section.sidebarOverflow').addClass('hidden');
		});
	},

	close: function() {
		$('body').css('overflow', 'initial');

		$('section.sidebar').animate({
			right: '-100%'
		}, 300);

		$('section.sidebarOverflow').addClass('hidden');
	}
};

$(window).on('load', function() {
	Configurator.set(); // set session properties saved by user previously

	Localisation.changeLanguage(Configuration.language, function() {
		$('section.torrents').attr('view', Configuration.torrentView);

		$('ul.tabs').tabs();
		$(".tooltipped").tooltip();

		TopBar.statistics(); // initializes the statistics button
		TopBar.filterBar(); // initializes the filter bar
		FloatingButtonHelper.init(); // stop tooltips and buttons from being clicked when not shown
		
		Listener.setIntervals(); // set interval to get torrents & statistics

		Listener.addTorrent(); // initializes the addTorrent button
		Listener.updateSettings(); // updates settings (one-time)
		Listener.searchTorrent(); // initializes the search torrent feature
		Listener.searchTracker(); // initializes the search tracker feature
		Listener.toggleSpeedLimitButton(); // initializes the speed limit button
		Listener.showCredits(); // initializes the credits

		TransmissionServer.getSettings();
	}, true); // true to make sure that localisation shuts up
});
